/**
 * @type {(
 *   | {
 *       names: string[]
 *       surrogates: string
 *       hasDiversity?: false
 *     }
 *   | {
 *       names: string[]
 *       surrogates: string
 *       hasDiversity: true
 *       diversityChildren: {
 *         names: string[]
 *         surrogates: string
 *       }[]
 *     }
 * )[]}
 */
const flattened = Object.values(rawData).flat()

/** @type {(string: string) => string} */
const escapeString = string => string.replace(/[$()*+.?[\\\]^{|}]/g, "\\$&")

const toneNumberRegExp = /_tone([1-5])$/
/** @type {(name: string) => RegExp} */
const getToneNumberRegExp = name =>
  new RegExp(`^(${escapeString(name)})${toneNumberRegExp.source}$`)

const toneNames = ["light", "medium_light", "medium", "medium_dark", "dark"]
const toneNameRegExp = new RegExp(`_(${toneNames.join("|")})_skin_tone$`)
/** @type {(name: string) => RegExp} */
const getToneNameRegExp = name =>
  new RegExp(`^(${escapeString(name)})${toneNameRegExp.source}$`)

for (const emoji of flattened) {
  let line = emoji.surrogates

  if (emoji.hasDiversity) line += "/+"

  for (const emojiName of emoji.names) {
    let flags = ""

    if (emoji.hasDiversity) {
      let hasNumber = false
      for (const diversity of emoji.diversityChildren) {
        const re = getToneNumberRegExp(emojiName)
        const toneNumberIndex = diversity.names.findIndex(name => re.test(name))

        if (toneNumberIndex === -1) continue

        diversity.names.splice(toneNumberIndex, 1)
        hasNumber = true
      }
      if (hasNumber) flags += "#"

      let hasName = false
      for (const diversity of emoji.diversityChildren) {
        const re = getToneNameRegExp(emojiName)
        const toneNameIndex = diversity.names.findIndex(name => re.test(name))

        if (toneNameIndex === -1) continue

        diversity.names.splice(toneNameIndex, 1)
        hasName = true
      }
      if (hasName) flags += "!"
    }

    line += ` ${emojiName}${flags ? `/${flags}` : ""}`
  }

  if (
    emoji.hasDiversity &&
    emoji.diversityChildren.some(diversity => diversity.names.length > 0)
  ) {
    const toneNumbers = emoji.diversityChildren
      .flatMap(diversity => diversity.names)
      .map(name => name.replace(toneNumberRegExp, ""))
      .filter((name, index, array) => array.indexOf(name) !== index)
      .filter((name, index, array) => array.indexOf(name) === index)

    const toneNames = emoji.diversityChildren
      .flatMap(diversity => diversity.names)
      .map(name => name.replace(toneNameRegExp, ""))
      .filter((name, index, array) => array.indexOf(name) !== index)
      .filter((name, index, array) => array.indexOf(name) === index)

    for (const name of toneNumbers) {
      let hasName = false
      const nameIndex = toneNames.indexOf(name)
      if (nameIndex !== -1) {
        hasName = true
        toneNames.splice(nameIndex, 1)
      }

      line += ` ${name}/#${hasName ? "!" : ""}*`
    }

    for (const name of toneNames) {
      line += ` ${name}/!*`
    }
  }

  console.log(line)
}

